ヴェレダ　ローズマリー　バスミルク　200ml<BR><hr><BR>

地中海の太陽をたっぷり浴びて育ったローズマリー。<BR>そのクリアな香りが気分をすっきりとさせる入浴剤。<BR>半身浴や足浴、手浴などの部分浴にもお勧めです。<BR><BR>

《使い方》<BR>
お湯を張った浴槽にキャップ2～3杯程入れ入浴します。<BR>■入浴方法：疲れや緊張が続いた一日の終わりに、ぬるめのお湯を張って20～30分つかります。<BR>
■部分浴には1リットルのお湯に対しキャップ1～2杯程入れてください。<BR><BR>
※ガラス容器に入っていますので浴室でのお取扱いには十分お気をつけください。


